import React from 'react';
import { Card, Icon, Image, Container, Header, Grid, Button } from 'semantic-ui-react';

import * as cappuccino from '../Assets/cappuccino.jpeg';

// props: name, handleClose (from menupage)
class OrderPopUp extends React.Component {

  render() {

    return (
      <Container textALign='center'>
        <Card fluid>
          <Card.Content>
            <Button circular icon='user' size='mini' floated='right' />
            <Image src={cappuccino} />
            <Card.Header>{this.props.name}</Card.Header>
            <Card.Meta>
              {/* description */}
            </Card.Meta>
          </Card.Content>
          <Card.Content extra>
            <a>
              <Icon name='user' />
              22 Friends
            </a>
          </Card.Content>
        </Card>
      </Container>
    );
  }
}

        export default OrderPopUp;
